        return new Source("{% extends 'base.html.twig' %}
{% block stylesheets %}
{% endblock %}

{% block body %}
    <section class=\"jumbotron text-center\">
    <div class=\"container\">
      
<form method=\"post\">
    {% if error %}
        <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
    {% endif %}

    {% if app.user %}
        <div class=\"checkbox mb-3\">You are logged in as {{ app.user.username }}, <a href=\"{{ path('app_logout') }}\">Logout</a>
    {% endif %}
    <h1 class=\"jumbotron-heading\">Please sign in</h1>
    <label for=\"inputUsername\" class=\"sr-only \">Username</label>
    <input type=\"text\" value=\"{{ last_username }}\" name=\"username\" id=\"inputUsername\" class=\"form-control \" placeholder=\"Username\" required autofocus>
    <label for=\"inputPassword\" class=\"sr-only login\">Password</label>
    <input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" placeholder=\"Password\" required>

    <input type=\"hidden\" name=\"_csrf_token\"
           value=\"{{ csrf_token('authenticate') }}\"
    >

    {#
        Uncomment this section and add a remember_me option below your firewall to activate remember me functionality.
        See https://symfony.com/doc/current/security/remember_me.html

        <div class=\"checkbox mb-3\">
            <label>
                <input type=\"checkbox\" name=\"_remember_me\"> Remember me
            </label>
        </div>
    #}

    <button class=\"btn btn-lg btn-primary\" type=\"submit\">
        Sign in
    </button>
</form>
      </p>
    </div>
  </section>
{% endblock %}
